import React from 'react';
import Footer from '../../components/Footer';
import Header from '../../components/Header';
import './style.css';
import InverseLogo from '../../assets/image/Logoinvertida.png';
import InverseLogoSenai from '../../assets/image/senailogobranca.png';

function Sobre() {

    return (
        <div >
            <Header />
            <div className="sobre" >

                <div className="containersobre">
                    <div className="imagens">
                        < img id="logo" src={InverseLogo} alt="logonegativo" />
                        <img id="logoSenai" src={InverseLogoSenai} alt="logonegativo" />
                    </div>

                    <div className="texto">
                        <ul>
                            <li>A Real Vaga é uma agência de empregos paulista de grande</li>
                            <li>prestígio no mercado de trabalho, parceira da renomada  </li>
                            <li>instituição de ensino SENAI. Nosso objetivo é capacitar </li>
                            <li>alunos e ex-alunos desta instituição a encontrar empregos</li>
                            <li>adequados para sua formação profissional de forma simples e rápida.</li>
                        </ul>
                    </div>
                </div>



            </div>

            <div className="footer-sobre">
                <Footer />
            </div>


        </div>
    )
}

export default Sobre;
